import React, { useState } from "react";
import { Link } from "react-router-dom"; 
import "./Header.css";
import logo from "../Assets/Imagenes/Logo.png";
import userImage from "../Assets/Imagenes/User.png"; // Imagen de usuario

const Log = 1; // Variable declarada temporalmente para pruebas

const Header = () => {
    const [showMenu, setShowMenu] = useState(false);

    return (
      <header>
        <div className="logo-container">
          <img src={logo} alt="Logo" className="logo" />
        </div>

        <div className="search-container">
          <input type="text" placeholder="Buscar..." className="search-input" />
        </div>

        <div className="right-container">
          {Log === 1 ? (
            <div className="user-info">
              <button>USERNAME</button>
              <div 
                className="user-image-container"
                onMouseEnter={() => setShowMenu(true)}
                onMouseLeave={() => setShowMenu(false)}
              >
                <img src={userImage} alt="User" className="user-image" />
                {showMenu && (
                  <div className="dropdown-menu">
                    <button>1aaaaaaaaaaaaaaaaaaaa</button>
                    <button>21aaaaaaaaaaaaaaaaaaaa</button>
                    <button>31aaaaaaaaaaaaaaaaaaaa</button>
                    <button>41aaaaaaaaaaaaaaaaaaaa</button>
                    <button>51aaaaaaaaaaaaaaaaaaaa</button>
                  </div>
                )}
              </div>
            </div>
          ) : (
            <>
              <Link to="/register">
                <button>Registrarse</button>
              </Link>
              <div className="divider"></div>
              <Link to="/login">
                <button>Iniciar Sesi√≥n</button>
              </Link>
            </>
          )}
        </div>
      </header>
    );
};

export default Header;
